import React from 'react'




function Signup() {

  let [users,setUsers]=useState([]);

  let [err,Seterr]=useState("")


  let getusers=()=>{
    axios.get(" http://localhost:4000/users")
    .then(response=>{ 
      if(response.status===200){
        setUsers(response.data);
      }
     },[]) 
    
    .catch(err=>{

    if(err.response){Seterr(err.message)}  
    else if(err.request){Seterr(err.message)}
    else {Seterr(err.message)}
  })
  
  }

  return (
    <div>
    <p className='fs-3 text-center'>Signup</p>
    <div className="row">
      <div className='col-11 col-sm-6 mx-auto'>
      <form>
         <div className='mb-3'>
    <label htmlFor='name'>Name</label>
    <input type="text" name="" id="name" className="form-control"/>
   </div>
   <div className='mb-3'>
    <label htmlFor='name'>Email</label>
    <input type="email" name="" id="name" className="form-control"/>
   </div>
   <div className='mb-3'>
    <label htmlFor='name'>Date of birth</label>
    <input type="date" name="" id="name" className="form-control"/>
   </div>
   <button className='btn btn-success mb-3'> Register</button>
    </form>
      </div>
      </div>
      </div>
  )
}

export default Signup
